pragma solidity ^0.8.9;

import "hardhat/console.sol";
import "./PriceConverter.sol";

contract FundMe {
    using PriceConverter for uint256;

    address public immutable i_owner;
    uint256 public constant MINIMUM_USD = 50 * 1e18;

    address[] public funders;
    mapping(address => uint256) public adressToAmountFunded;

    AggregatorV3Interface public priceFeed;

    constructor(address _priceFeed) {
        i_owner = msg.sender;
        priceFeed = AggregatorV3Interface(_priceFeed);
    }

    modifier onlyOwner() {
        require(msg.sender == i_owner, "Only owner can do this.");
        _;
    }

    function fund() public payable {
        require(msg.value.getConversionRate(priceFeed) >= MINIMUM_USD, "Didn't send enough!");
        funders.push(msg.sender);
        adressToAmountFunded[msg.sender] = msg.value;
    }

    function widraw() public onlyOwner {
        for (uint256 i = 0; i < funders.length; i++) {
            adressToAmountFunded[funders[i]] = 0;
        }

        funders = new address[](0);

        payable(msg.sender).transfer(address(this).balance);
    }

    receive() external payable {
        fund();
    }

    fallback() external payable {
        fund();
    }
}
","keccak256":"0x0e821489582ae2cf7d0f4ebb72a8c0bac7cf4a0dbc6d8bedc4d86f35d5904da6","license":"MIT"},"contracts/PriceConverter.sol":{"content":"// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

library PriceConverter {
    function getPrice(AggregatorV3Interface _priceFeed) internal view returns (uint256) {
        (, int256 answer, , , ) = _priceFeed.latestRoundData();
        // ETH in terms od USD
        // 1600.00000000
        return uint256(answer * 1e10); // 1**10 == 10000000000
    }

    function getConversionRate(uint256 _ethAmount, AggregatorV3Interface _priceFeed)
        internal
        view
        returns (uint256)
    {
        uint256 ethPrice = getPrice(_priceFeed);
        uint256 ethAmountInUsd = (ethPrice * _ethAmount) / 1e18;

        return ethAmountInUsd;
    }
}
